(1, 'Former VW boss charged over diesel emissions scandal', '2019-04-15', 'BBC News', 3, 'The former chief executive of the carmaker Volkswagen has been charged in Germany over his involvement in the company''s diesel emissions scandal.\r\nThe public prosecutor in Braunschweig charged Martin Winterkorn and four other managers with fraud.\r\nVW said it would not comment on the indictments.\r\nMr Winterkorn is already facing criminal charges in the US, but is unlikely to face trial, as Germany does not extradite its citizens.\r\nThe 71-year-old resigned soon after the scandal erupted in September 2015.\r\nIn a statement, prosecutors accused Mr Winterkorn of a "particularly serious" fraud, as well as a breach of competition laws.\r\nThey said Mr Winterkorn should have alerted car owners and authorities in Europe and the US about the manipulation of diesel emissions tests sooner.\r\nThey also accused him of approving a "useless" software update designed to conceal the true reason for the cars'' higher emission levels.\r\nIf found guilty, the former executive could face a prison sentence of up to 10 years.\r\nProsecutors did not name the other four senior managers charged.\r\nVW first admitted in September 2015 that it had used illegal software to cheat US emissions tests.\r\nThe devices, which allowed vehicles to perform better in test conditions than they did on the road, were installed on almost 600,000 vehicles sold in the US from 2009 though 2015 and millions more globally.\r\nThey came to light after a study of emissions by researchers at West Virginia University in the US.\r\nThe scandal sparked investigations in Germany and other countries.\r\nTo date, it has cost Volkswagen roughly €28bn, ($31bn; £24bn).\r\nLast month, the US Securities and Exchange Commission (SEC) sued Volkswagen and Mr Winterkorn, accusing the carmaker of "massive fraud" over the emissions scandal.\r\nThe SEC claims the firm misled investors by issuing billions of dollars worth of bonds and securities, without disclosing that it had cheated emissions tests.\r\nThe company said it would contest the SEC lawsuit vigorously.\r\nVW''s current chief executive Herbert Diess told the BBC he believed the company was "over the worst" of the Dieselgate fallout, but said that it still had to win back the confidence of its customers.', 12),
(2, 'Brexit: BMW could cut shifts at Mini plant in event of no-deal', '2019-09-09', 'BBC News', 3, 'Workers at the Mini plant in Oxford could see their shifts cut in the event of a no-deal Brexit, BMW''s finance chief has told the BBC.\nNicolas Peter said production was likely to fall at the Cowley factory, affecting jobs.\nBut he said BMW, which also makes Minis in the Netherlands, had no plans to "shift production" as yet.\nBoris Johnson has said he plans to take the UK out of the EU on 31 October - with or without a deal.\n"No-deal would mean that, most likely, [World Trade Organization] tariffs would be imposed from 1 November onwards," said Mr Peter, who was attending the Frankfurt motor show.\n"This would mean that we would most likely have to raise the prices of the products produced in the UK and shipped to other markets [in the EU].\n"The increase of price means an impact on the volume you sell, and would eventually lead to a reduction of produced cars in Oxford."\nAs a result, he said, the factory would have to reduce its output, and would use production cuts "as a first step" to cope.\n''Constructive solution''\nA range of car companies in the UK have warned that the loss of frictionless trade after a no-deal Brexit could damage their business.\nFor example, the PSA Group has said it will only build the next generation Vauxhall Astra at its Ellesmere Port plant if a satisfactory Brexit deal is reached.\nInvestment in the industry has also fallen sharply amid fears the UK will no longer be a competitive place to build cars if it crashes out of the bloc.\nMr Peter said there were no plans to close any UK factories on the table, but the firm will shut its Cowley plant on 31 October and 1 November .\nShutdowns are common in the car industry, and BMW as well as Toyota plan to pause production to minimise disruption after Brexit.\n"But of course what''s extremely important is to use the weeks we have before 31 October to develop and implement a constructive Brexit solution," Mr Peter said.\nSome politicians have argued that warnings about the potential damage of a no-deal Brexit have been exaggerated.\nBefore becoming Leader of the House of Commons, pro-Brexit Conservative MP Jacob Rees-Mogg said in July that quitting the EU without a deal could result in an £80bn boost for the economy.\nHe also dismissed as "pure silliness" Treasury forecasts warning of a £90bn hit to the UK - projections that former Chancellor Philip Hammond later described as "terrifying".\n', 2),
(8, 'New Volkswagen Golf GTE will have 201bhp and 241bhp variants', '2019-09-18', 'Autocar', 3, 'The next-generation Volkswagen Golf GTE will offer two power outputs when it arrives on roads next year, intended to cater to both those wanting a standard plug-in hybrid and those in the market for a performance-focused PHEV.\n\nVolkswagen board member for research and development Frank Welsch told Autocar that the GTE will be sold with either 201bhp or 241bhp. He said: “Today’s GTI is 241bhp, so the GTE should also have 241bhp, so the GTE is really a GTE. But there are some people who just want to stay with a similar plug-in hybrid to today, so that''s why we’re offering the 201bhp, too. It comes without the GTE trim and just [appears] as a normal Golf.” There will be no new electric e-Golf, because Volkswagen will focus on its standalone ID 3 model instead.\nThe new Golf GTE has been spotted testing undisguised near the Nürburgring ahead of the eight-generation Golf’s reveal next month. The spy shots also show Volkwagen’s new logo, revealed at Frankfurt motor show last week.\nThe standard car has already been seen with virtually no disguise before. But now a prototype has been spotted with a charging port built within its front wing, suggesting it is the flagship PHEV model.\nThe latest version of the long-running hatchback was originally due to be unveiled alongside the ID 3 at the Frankfurt motor show, but Volkswagen bosses decided to focus that event on its new electric offering. The Mk8 Golf has now been confirmed for an October launch. It will go on sale in the UK early next year.\nVolkswagen design chief Klaus Bischoff said the Golf will feature “elegant proportions”. The German firm says the eighth-generation Golf had been designed for “the era of electrified drives, a digitalised and connected interior world, assisted driving and online-based functions and services.”\n\nVolkswagen previously released a design sketch of the Mk8 model that showed a distinct evolution of its interior look and technology. It revealed that the Golf will adopt a large, dual-screen instrument and infotainment display panel stretched across the driver''s eyeline. The rest of the interior has a more minimalist look as a result.\nThe car is also expected to have an interior that’s almost completely devoid of conventional switches, at least on the higher-end models. Volkswagen design boss Klaus Bischoff has been quoted as saying that the Mk8’s interior is a “total” digital environment, with the steering wheel the only conventional component. Touchscreens will replace the traditional instrument binnacle and the climate controls. Even the headlight switch could be replaced by a touchpad. Volkswagen''s management have also begun offering some details about the latest version of the Golf, the most important machine in the firm''s range.\nSpeaking at the Geneva motor show back in March, marketing boss Jürgen Stackmann said the new Golf maintained the heritage of previous versions, but with the benefits of new technology.\n"The new Golf will be everything people loved for years, but now made digital," he said. "People want a Golf – it''s iconic – but now there''s a huge leap forward in the digitisation inside it. It''s still a Golf, but now digital. It''s kept what people have loved and moved it to the next phase."\nThe Mk8 Golf will have levels of fuel-saving technology, connectivity, autonomous driving capability and refinement that are intended to render the mainstream competition second best.\nIts exterior styling will be an evolutionary design that again emphasises a wide, flowing C-pillar. There is expected to be a little more sharp-edged definition to the bodywork, following the template of the latest Polo. The GTI version will feature large corner air vents in its lower bumper, as previewed by the GTI TCR concept earlier this year.\nVolkswagen will use the Mk8 Golf to introduce a powerful 48V mild-hybrid powertrain and a new range of micro-hybrids. There will also be versions powered by compressed natural gas.\nThe model’s range will be simplified, with the three-door and estate bodystyles the most likely candidates for the axe. With consumers increasingly turning to SUVs and crossovers, and with makers of large mainstream cars under significant cost and profit pressures, insiders say the Golf Mk8 will attempt to lure buyers who are downsizing from larger cars and premium models such as the BMW 3 Series and Mercedes-Benz C-Class, offering more cabin and luggage space than is normal in this segment, outstanding refinement and exceptional fuel economy. \nThe new Golf will have a noticeably wider track and even more room in the already spacious cabin, as well as a marginally longer wheelbase and a bigger boot than its hatchback rivals.\n\nUpdate of Mk7 platform\nThe basis for the next Golf is an updated version of the versatile MQB platform used by today’s model. VW insiders suggest it will use a greater percentage of lightweight metal than the existing structure for a 50kg reduction in weight.\nPlanned modifications to the construction process are also said to provide more streamlined production and reduced build times as part of a strategy aimed at improving the economy of scale and profitability of VW’s best-selling model.\nAlthough there is still some time to go before the new Golf’s introduction, VW says it has already locked in the car’s design, which has been developed under the guidance of the company’s latest design boss, Michael Mauer, who was responsible for the styling of the current Porscheline-up.\nThose privy to the latest clay model mock-ups say the new Golf advances the classic hatchback look of its predecessors, with familiar proportions, reinterpreted details and simple surfacing to make it instantly recognisable as a Golf.\nKey styling features described to Autocar include a thin horizontal grille bookmarked by smaller angular headlights than those in use today, with a distinctive LED daytime running light graphic. The new car is also said to have more pronounced wheel arches and a heavily defined side swage line, in combination with typically wide C-pillars and a relatively upright tailgate.\n\nPetrol and diesel engines\nThe new Golf Mk8 will get a range of 12V mild-hybrid engines for the entry-level and mid-range variants. The 1.5-litre TSI ACT petrol unit will be carried over from today’s Golf Mk7 but this will be joined by a 1.0-litre three-cylinder petrol motor and an all-new 1.5-litre diesel, which is also likely to be sold as a 12V mild hybrid. Autocar understands that the assistance of the mild-hybrid system’s starter/ generator lessens the load on the engine and reduces the spikes of NOx emissions from the diesel’s exhaust.\nOne of the more intriguing rumours is that the 1.0-litre petrol engines might not be turbocharged at all, but could instead rely solely on direct assistance from a belt-driven starter/generator motor (SGM). The thinking is that the SGM will provide enough extra power and torque for the base engines, allowing the turbocharger, intercooler and associated piping and control systems to be dropped. \nThe Golf Mk8’s diesel line-up will include the new 2.0 TDI (codenamed EA288 Evo) engine. VW says the base version of this unit has been significantly re-engineered to reduce exhaust pollution. There is a more efficient and responsive turbocharger and the engine is lighter, loses less heat and has reduced internal friction.\nMore important, the engine’s particulate filter and catalyst have been resized for improved performance, particularly over time. VW claimed the engine offers an average of 9% more torque and power together with an average 10g/km decrease in CO2 emissions. The firm said the new diesel unit will come in versions ranging from 135bhp to 201bhp and will be seen in Audi models before being installed in the Golf Mk8 next year.\nCrucial ID concept - click here for more\nVW has already released details of the Golf’s 1.5-litre TGI Evo natural gas engine, production of which starts this year. Based on the 1.5-litre TSI engine, the TGI unit uses the same Miller cycle valve timing and a variable geometry turbocharger. It develops 129bhp and 148lb ft from 1400rpm when installed in the Golf Mk7. VW claims that this engine emits about 93g/km of CO2 on the NEDC cycle when it is hooked up to the standard- issue dual-clutch gearbox. Natural gas engines are also lower in NOx and particulate emissions than diesel and cars can be refilled from the gas mains network via small wall-mounted compressors. However, the lack of a natural gas infrastructure in the UK means this variant is unlikely to reach these shores.\nThe new or upgraded powertrains will be offered in combination with either a six-speed manual or seven-speed dual-clutch automatic gearbox, depending on their configuration. Alongside front-wheel drive, VW also plans to offer optional four-wheel drive (which it calls 4Motion) in selected models, like it has done in the previous four generations of its perennial best seller.\n\nTwo kinds of mild hybrid\nThe big surprise for the Golf Mk8 drivetrains is that VW says it will be investing in both 12V and 48V mild-hybrid systems after the company re-engineered the Golf family MQB electrical architecture (one of the more expensive component systems in a car) to accommodate a 48V system. Until now, 48V mild hybrids have only been used in premium VW Group cars such as the Bentley Bentayga and Audi SQ7.\nFrank Welsch, VW’s technical development boss, has already revealed the firm’s new ‘affordable’ 48V system, which uses a belt-integrated starter/ generator/alternator to assist the engine by providing extra power and torque directly to the engine’s crankshaft.\nThe key to adopting 48V in a mass-market car was VW and its suppliers developing a less expensive and more compact set-up, which uses a small DC-to-DC converter and small lithium ion battery.\nWelsch said the 48V set-up allows much greater amounts of energy to be recuperated than with 12V systems, which means significantly improved fuel economy. These new mild-hybrid engines can also start and stop extremely quickly, which will allow the Golf Mk8 to switch in and out of coasting mode when driving, making further fuel savings.\n\nConnected tech takes precedence\nVW sources have already promised that the next Golf will be ‘always connected’. Using the same eSIM card that has already appeared in the new Touareg, the Golf Mk8 will be permanently connected to the internet. This will allow the car to tap into 3D satellite mapping, hybrid radio (where the audio system finds the strongest signal for a station, whether analogue or digital) and the option of live information such as the latest pricing at nearby fuel stations.\nThe permanent connectivity opens the way for these future models to ‘read’ the topography of the road from 3D mapping, for example, and switch to coasting when heading downhill, or approaching a junction.\nAutonomous driving will be a key feature of VW''s best-seller in its eighth generation, as the brand will shoehorn even more advanced autonomous technology into the new model, as well as ensuring that it is the most connected car in the company''s history, ahead of the all-electric ID hatchback that''s also due in late 2019. \nHead of VW''s compact series, Karlheinz Hell, revealed: "The next Golf will take Volkswagen into the era of fully connected vehicles with extended autonomous driving functions. It will have more software on board than ever before. It will always be online and its digital cockpit and assistance systems will be the benchmark in terms of connectivity and safety."\nThe current Golf benefits from VW''s semi-autonomous Traffic Jam Assist system, which controls the steering, acceleration and braking of the car under 37mph, so it''s certain that the Mk8 model will take a leap in advancement over this. Elsewhere, the Audi A8 is the first car in the wider VW Group to achieve level three autonomy where permitted.\n\nGolf to set VW design agenda\nWhile the new Golf will be an evolutionary take on the outgoing car, it will feature new design elements that design chief Klaus Bischoff described being “more fluid, more sporty with a very unique face”.\nIt’s part of a new VW strategy to differentiate its standard model range from the new ID family of electric cars, said Bischoff: “[ID is] a new world of proportions and totally new bodystyles which are more emotional. As we go through the ceiling design- wise on ID cars, we need to echo that with ICE cars, so these will have more sporty proportions [and] a more progressive, clean design.”\nBischoff said future cars will remain faithful to VW’s traditional design cues: “We are looking to our origins so no ‘me too’ products. They will all remain as very individual VWs. \n“If you look at front- of-car designs, nearly everybody is copying Audi. VW will go down its own road to stay true to the brand, and not look over the fence to others.” \nVolkswagen reaps MQB’s rewards\nVolkswagen’s MQB architecture underpins its best-selling model, the Golf, of which 968,284 were sold in 2017.\nThe modular toolkit is used for most of the firm’s most successful models. In total, five MQB models currently account for 3.8 million global sales.\nThe firm’s second-bestseller last year was the Jetta/Sagitar (the latter is a Chinese-market compact saloon), with 883,346 units sold. The seventh-generation Jetta, which went on sale this year, is now based on MQB, as are the firm’s two next best-sellers: the Tiguan SUV (769,870 sold), in both short- and long-wheelbase forms, and the Polo. \nThe Lavida, a Jetta-sized MQB saloon sold only in China, is the firm’s sixth best-selling model, with 507,000 made in 2017. That leaves the Passat/Magotan family, which is sold in Europe, the US and China. Current European versions of this model are built on MQB, with the US and Chinese versions switching to the architecture in 2019, adding another 660,000 or so MQB cars to the sales total.\nThose figures are simply for Volkswagen itself: the MQB toolkit is also used widely across the group’s other brands.\n', 12),
(11, 'Ford in talks with VW to develop second EV in Europe, paper says\n', '2019-09-17', 'Automotive News', 1, 'FRANKFURT -- Ford Motor could build more than one electric vehicle based on Volkswagen Group''s EV platform, Ford of Europe President, Stuart Rowley, told a German business paper.\n\nTo make only one model made no sense financially, and a decision about whether to build a second model could happen soon, Rowley is quoted telling Handelsblatt.\n\n"Yes, we are in talks about this," Rowley told the paper.\n\nFord said in July that it will use VW''s modular electric toolkit, known as MEB, to design a new battery-electric vehicle for its European operations. The automaker said it expects to deliver more than 600,000 MEB-based vehicles in Europe over a six-year period starting in 2023.\n\nVW has invested $7 billion in its MEB architecture since 2016. It plans to use MEB to underpin about 15 million cars for its VW, Audi, Skoda and Seat brands including hatchbacks, sedans, crossovers and minivans in the next decade.', 5),
(13, 'Renault Kadjar: ‘A great all-rounder’', '2019-08-11', 'The Guardian', 4, '“Who on earth is this car supposed to appeal to?” grumbles Jeremy as he eases himself into the passenger seat of Renault’s mid-market, mid-sized crossover. Jeremy, 52, is happily married with two teenage daughters. He’s a fan of good design, but he’s also a realist – he’ll always favour function over form. But his fatal flaw is that he doesn’t realise that. I don’t answer his question, but after a moment or two, Jeremy looks at me and laughs: “Ah, I see, this car is supposed to appeal to me! I am its target audience.” As usual, Jeremy doesn’t know what he’s talking about. He has no reason to be snitty about this latest model from Renault. It packs quite a punch. Its combination of low-key looks, economy, practicality, comfort and usable space means it will be a loyal servant to every family that decides to take it into their service.\r\n\r\nThe Kadjar sits midway up Renault’s size pyramid: it’s bigger than the Captur and smaller than the Koleos. The first car I ever owned was a Renault. Cute and colourful, it sprouted rust and moss with exuberance. It cost £15 and a cup of coffee and lasted for six months before it collapsed outside a breaker’s yard. They bought it from me for £15 – so I had six months motoring for the price of a cappuccino. Anyway, the point of this little diversion is that it was a Renault 5. A simple and classy name compared with the fridge magnet roulette Renault’s branding team use now to create their model names.\r\n\r\nThe name Kadjar, which sounds like cadger, but in fact comes from the word “kad”, was apparently inspired by the French word for four-wheeled and “jar”, derived from the French for agile. Renault believes it has everything it needs to become one of the brand’s biggest sellers.\r\n\r\nHowever, the massively overcrowded shark pool it finds itself swimming in is dominated by Nissan’s Qashqai. And if that isn’t intimidating enough, it will also have to go mano a mano with the likes of Kia Sportage, Ford Kuga, Peugeot 3008, Honda HR-V and Skoda Karoq. It’s a clever move, therefore, that the Kadjar has taken its lead from the alpha car of the group. Behind its eyecatching grille and swooping body panels, this Renault is, in fact, a Qashqai. Renault has an alliance with Nissan. It is also in cahoots (which sounds like a good name for Renault’s next model) with Mercedes. The alliance includes sharing engine technology with Daimler. Pop open the bonnet of a Kadjar, Qashqai and A-Class and you’d find they’re all powered by the same 1.3-litre four-cylinder turbo, with either 138bhp or 158bhp. As Oscar Wilde said: “Imitation is the sincerest form of flattery…” It’s also available with a 1.5-litre diesel.\r\n\r\nThe Kadjar is resolutely a family car. When Jeremy asks me what it’s like to drive, I say: “Like a family car.” And I don’t mean that as any kind of put-down. It’s comfortable, with soft steering and a steady throttle. It’s perfectly pleasant. It’s not a sports car. And any vehicle that offers a more involved “driver’s” drive would lose the battle to keep its consumption down. The 158bhp version delivers up to 65.7mpg. I found the real-world figure was closer to 40 miles to the gallon, which is still very impressive in a car like this.\r\n\r\nThe interior is roomy, practical and well-made. Leather trim on the dash breaks up the usual sweep of hard plastics that often features on a car like this. It’s a five-seater with lots of headroom and a large boot.\r\n\r\nThe Kadjar doesn’t excel in any one particular area, but it’s a great all-rounder. It looks fine, drives well and won’t let you down… a little like Jeremy himself.', 11),
(15, 'Mercedes-Benz AMG GT 4-Door: ‘Is this family hatch too hot to handle?’\r\n', '2019-07-14', 'The Guardian', 4, 'People behaving rather inappropriately in cars is nothing new. But this is the first time in which the vehicle itself has behaved questionably, and come over all handsy. “Dad,” laughs my 17-year-old daughter, “your Mercedes is creepy. It has issues with consent…” She''s referring to its “dynamic self-bolstering” seats. When you corner, an air bladder on the outside edge automatically inflates to hold you in position. It feels like a large hand curling unexpectedly around your side. Once you know what''s going on, it''s quite relaxing, particularly on long, twisting journeys. Slaloming up and over the Alps, for instance. The smart seats are actually minor miracles and this entire review could easily focus just on them. They can be heated or cooled; they have 19 different air chambers each of which can be minutely adjusted; there are multiple massage functions to choose from, too. They''re incredibly comfortable – though my wife claims the ones at her nail bar are even better.\r\n\r\nThese seats are just one aspect of the super-smart technical smörgåsbord served up by the Mercedes-Benz AMG GT 4-Door. From the welcome graphic that pops up on its double-width digital dash when you first get in, to the final burbling note of the four-pipe exhaust, there is not one single aspect that has not been buffed and puffed to maximise its potential.\r\n\r\nAMG is the high-performance wing used by Mercedes-Benz to weaponise its “standard” models. Essentially, AMG exists to put the OMG into already excellent cars. And that is exactly what AMG has now done to the GT.\r\n\r\nThe model already existed as a searingly quick, headturningly attractive coupé. But it had one serious drawback: it only had two doors. What was needed, clearly, was a four-door, four-seat, hatchback version. And lo, we now have the AMG GT 4-Door – quite a catchy name, isn''t it? There was also the small matter of what would power this übermensch family hatch. In the case of GT''s range-topper it''s a fire-breathing 4-litre bi-turbo V8 capable of delivering 631bhp – or 0-62mph in 3.2 seconds. For comparison, the market-leading Ford Focus family hatch starts at just 99bhp.\r\n\r\nThe car is large and very imposing. At the front there is an architectural 20-fin air panel; at the back a spoiler that eases out of the bodywork but only when it''s on duty. The car is unusually long (over 5m) and heavy (over 2 tonnes), but like a well-cut suit on a fat man, its shape is flattered by graceful curves and an elongated silhouette. Performance is, as you might have guessed, scorchio. Despite all the showmanship it can be remarkably biddable and easy to live with. On family days you select Comfort from the drive mode menu and tootle along – as you would in any family hatch. On “self-focused days”, you might go for Sport, Sport+ or even Race – at which point the driving should really be left to the professionals. It''s a phenomenal machine, but for most it''ll remain too hot to handle.', 9),
(16, 'The Guardian view on Honda’s closure: of course it’s partly about Brexit', '2019-02-19', 'The Guardian', 5, 'The Japanese carmaker’s decision to shut its Swindon factory is part of a pattern in which Brexit uncertainties play a significant role\r\n\r\nFirst, the uncontroversial bit. Honda’s decision to close its factory at Swindon is a body blow to the west of England economy, to the British car industry, and to the UK manufacturing sector more widely. It will not be easy for the Wiltshire town to absorb the massive hit. Now, the more controversial part. The Japanese carmaker’s decision reflects several factors. These include a Europe-wide market shift from diesel to electric cars. But it unquestionably also reflects continuing uncertainty about Brexit’s impact on the UK economy and the fear of a no-deal exit from the EU – and anyone who pretends otherwise is simply not telling the truth.\r\n\r\nHonda has been in Swindon since 1989. It came because the UK went to great lengths to persuade the car giant that Swindon was the right site to supply the European Union market, of which Margaret Thatcher’s Britain was a keen advocate. Output has declined since the financial crisis, leaving only one model, the Civic, in production at a factory that used to produce three. Nevertheless, until now, Honda has not closed a vehicle factory in its 70-year history anywhere in the world. It has also tried hard to keep Swindon open, even though production of 160,000 vehicles a year there is “sub-scale” when compared with the output of 2m in China and the US. Now Swindon is to close in 2021, leaving 3,500 Honda workers out of work, along with at least that number in the supply chain and associated businesses.\r\n\r\nAnnouncing the closure on Tuesday, Honda said Brexit was not taken into account. “This is not a Brexit-related issue for us,” said its senior vice-president for Europe, Ian Howells. The company is being too polite. In the past, Honda has been keen to warn against the consequences of a disorderly Brexit. If Britain were to leave the EU customs union, the company said last summer, border checks could clog up the company’s waste-averse supply chain. The breadth of the Brexit challenge was “unprecedented in terms of its total impact”, said the same Mr Howells. That challenge has not changed, and is now potentially more acute as the prospect of no-deal deepens.\r\n\r\nIt would be wrong to argue that Honda’s decision is solely about Brexit. The global market for cars is restructuring in response to threats to the ecosystem caused by harmful car emissions. But it is equally wrong to pretend that it has nothing to do with Brexit either. By leaving the EU, Britain is reneging on the access to the European market it originally offered to Honda; Honda is therefore bound to think again. In a European car market that, like markets elsewhere, survives on high-volume, just-in-time production, Brexit removes the Swindon plant from the arena without compensating gains. With tariffs between the EU and Japan now ending, and Brexit likely to raise the cost of parts and reduce access to the EU, Britain’s decision leaves Honda with few real options.\r\n\r\nHonda’s decision in Swindon is also part of a pattern. Nissan is scaling back its plans for Sunderland. Toyota may leave Burnaston. Likewise BMW in Cowley. The business secretary, Greg Clark, maintains a calm veneer about Honda, but his words – “devastating”, “dismay” – convey something close to panic at the existential threat facing parts of British industry. Nor is the mood confined to multinationals: the farmers’ union president talked in similar terms – “catastrophe”, “nightmares” – on Tuesday too. The reaction of doctrinaire Brexiters, meanwhile, is shameless. “Nothing to do with Brexit whatsoever,” says the chair of Leave Means Leave. Oh, but it is. It really is. Leaving the single market and the customs union is their mess. Even now, they must be stopped.', 6),
(17, 'Ford to close Bridgend factory by September 2020', '2019-06-06', 'The Guardian', 6, 'Ford has confirmed that it will close its Bridgend engine plant in September 2020 with the loss of 1,700 jobs, in the latest blow to the embattled British car industry.\r\n\r\nWorkers at the plant were informed on Thursday morning about the decision, which is a major setback for the south Wales economy and an automotive sector bracing for the impact of Brexit.\r\n\r\nFord blamed the closure on the imminent end to a contract for engine production for Jaguar Land Rover (JLR) as well as a global decline in demand for the Ford engines made in Bridgend. The news comes in the wake of thousands of UK job cuts announced this year by Honda and JLR.\r\n\r\nStuart Rowley, the president of Ford in Europe, said the closure was prompted by the US carmaker’s global cost-cutting drive, including about 550 white-collar job cuts announced in the UK last month. However, he added that Bridgend was more expensive than other plants building the same engine because it only had demand for less than a fifth of the 700,000 engines it produced in its peak years.\r\n\r\nHe said: “Changing customer demand and cost disadvantages, plus an absence of additional engine models for Bridgend going forward make the plant economically unsustainable in the years ahead.”\r\n\r\nProduction of Ford’s 1.5 litre Dragon engines will cease in February, followed by the end of production for JLR in September 2020. The closure will cost Ford $650m (£512m) in redundancy and pension payments.\r\n\r\nFord has three factories in the UK, the others being a plant in Dagenham, east London, which produces diesel engines for vans, and a gearbox plant in Halewood, on the outskirts of Liverpool. Rowley said the remaining two sites – which employ a total of 2,100 people – have a “very firm future” and that there were no plans for further job cuts at either.\r\n\r\nRowley renewed Ford’s warnings that it would have to carry out a further review of its operations – including the possibility of closing more British factories – in the case of a no-deal Brexit. However, he insisted that Brexit was not a factor in the decision to close Bridgend.\r\n\r\n“This action has nothing to do with Brexit,” he said. “If Brexit had never happened would it have been a different decision? The answer to that is no.”\r\n\r\nFord received some interest in taking over Bridgend, including from Ineos, the chemicals company owned by the billionaire Jim Ratcliffe, which is planning to manufacture a new off-road vehicle. However, those plans did not come through and Rowley said the plant was not a contender for much-hoped-for investment in battery assembly because of its distance from Ford’s car assembly factories.\r\n\r\nFord is only the latest in a string of international carmakers to reduce their UK operations this year. Honda announced in February that it planned to shut its Swindon plant in 2021, with the loss of 3,500 jobs, and Nissan has reversed its decision to build the new X-Trail vehicle at its Sunderland plant. JLR, the Indian-owned company that runs Britain’s largest carmaking operation, is also cutting thousands of jobs.\r\n\r\nThe Bridgend closure will leave Toyota’s Deeside engine plant and Aston Martin Lagonda’s new St Athan plant as the only major carmaking locations in Wales.\r\n\r\nJeff Beck, a regional organiser at the GMB trade union, which represents workers at the plant, said the decision was “a real hammer blow for the Welsh economy and the community in Bridgend”. Steve Turner, assistant general secretary of the Unite union, said Ford had betrayed workers in “an act of gross industrial sabotage”.\r\n\r\nThe plant indirectly supports the jobs of another 12,000 people in the local economy, according to estimates supplied to Madeleine Moon, the Labour MP for Bridgend. Ford will repay £11m in state aid given to it by the Welsh government to support the plant.\r\n\r\nWhile Ford insisted Brexit was not a factor, Moon said company executives had been outspoken in their warnings over the viability of the Bridgend operations to government ministers – even when offered similar support to the £61m awarded to Nissan.\r\n\r\n“They made it absolutely clear that a hard Brexit without a customs union and the single market would make it impossible to operate here,” she said.\r\n\r\n“You can’t keep throwing money at companies to get them to stay.”\r\n\r\nThe Ford plant has manufactured petrol engines since 1980 and supplies the company’s factories across Europe.\r\n\r\nThe company is undergoing a round of steep cost-cutting around the world. It announced widespread job losses across its European operations in January and said it would consider closing plants.', 5),
(18, 'Car Review: Nissan Leaf e+ – 240 miles on one charge', '2019-07-26', 'The Independent', 7, 'The new Nissan Leaf e+ looks pretty much like any other Leaf. And despite a decent boost in power compared with previous models, it feels pretty much the same to drive as well – smooth, quiet and responsive, as all electric cars are.\r\n\r\nSmooth, quiet and responsive – electric cars are a less fatiguing drive (Nissan)\r\nThe big difference is under the attractive if unassuming skin, in the form of a battery pack that is about fifty per cent bigger than any we have seen in a Leaf before. The first Leafs that appeared in 2011 had a 24kWh battery that offered a range of about eighty miles. An upgrade to 30kWh (about 100 miles) followed a few years later, and the current second generation version was launched with a 40kWh battery and a range of about 160 miles. Now the Leaf e+ has a 60kWh battery which should be good for 240 miles in decent conditions – three times as much range as that first Leaf could deliver just seven short years ago.\r\nYou can do a lot with 240 miles of range – London to Glasgow or Edinburgh with just one coffee stop for a rapid charge top-up for a start. Of course, 240 miles still falls short of the 300-plus miles a tank of petrol or diesel will give you but in the UK it should be enough for almost all drivers almost all of the time, an undreamt of luxury for owners of most earlier electrics.\r\n\r\nSuper saver: topping up at home costs only 2-3p per mile (Nissan)\r\nBut long-range electric cars aren’t just about matching the convenience of fossil-fuelled cars for long journeys in terms of the logistics of filling up. There’s something else going on too. Once you bust the old range limitations, electric cars are superb machines for long distance travel. Smooth, instant and effortless power delivery without gear-changing of either the automatic or the manual variety makes for a far less fatiguing driving experience over a long day at the wheel. Passengers arrive fresher too, thanks to very low levels of what motor industry people call NVH – noise, vibration and harshness – compared with petrols and diesels. Cars like the 240-mile Leaf e+ allow that advantage to be exploited to the full.\r\n\r\nAnd racking up the miles accentuates another advantage of electric cars – low operating costs per mile. Top up at home, and electricity will cost you 2-3p per mile, compared with about 10-20p per mile for petrol or diesel. These numbers can vary quite a bit depending on conditions and driving style, and charging away from home on the public charging infrastructure can be more expensive, but you get the idea. Add in zero road tax and lower servicing costs and, once you’ve paid for an electric car upfront, you won’t be putting your hand in your purse or your wallet very often after that.\r\n\r\nZero road tax and lower servicing costs are attractive propositions (Nissan)\r\nThat said, the upfront cost of going electric can still be quite high, especially if you want decent range. At least for the time being, the e+ with its new bigger battery is a top-of-the-range affair costing about £36,000. That’s around £8,000 more than the starting price for the more basic entry-level version, which sticks with the smaller 40kWh battery and a still pretty usable 160 miles or so of range.\r\nFor the time being, the e+ is expected to account for only a minority of Leaf sales but based on past experience, I’d expect the bigger battery pack to be offered more widely in future and perhaps eventually become standard across the range – not least because the Leaf is about to get a lot more competition in the form of a revamped Renault Zoe and new electric versions of the Peugeot 208 and Vauxhall Corsa. These cheaper cars will be offering 200-plus miles of range as well, although the slightly bigger Nissan will probably retain a bit of an edge in terms of practicality and interior space. \r\nThe message? Long-range electric cars have arrived and they''re here to stay.', 7),
(19, 'New Audi SQ7 TDI launched\r\n', '2019-07-22', 'Auto Express', 8, 'Audi has launched a new performance version of its largest SUV, called the SQ7 TDI. Due to launch in the UK this Autumn, the German brand’s latest sporty off-roader comes with a mild-hybrid diesel powertrain, a range of chassis upgrades and a host of styling and technology revisions. Prices for the new model will start from around £76,400.\r\n<br><br>\r\nThe Audi SQ7 TDI is powered by the same biturbo V8 diesel engine as the new Audi SQ8, producing 429bhp and 900Nm of torque. Like the German brand’s performance coupe-SUV, the SQ7’s engine is also fitted with a 48-volt electric compressor, which assists the two turbochargers when they’re off-boost.\r\n<br><br>\r\nThe compressor is fed by the same 48V lithium-ion battery pack which underpins the SQ7’s mild-hybrid system. Comprising a belt-driven alternator starter and an energy recuperation system, it can power the performance SUV at speeds up to 14mph and recover up to 8kW of energy under deceleration.\r\n<br><br>\r\nAudi says the SQ7 can dispatch the 0–62mph sprint in 4.8 seconds and reach an electronically limited top speed of 155mph. It should also be reasonably efficient, with the German firm claiming economy figures of 37mpg and emissions ratings of around 200g/km of CO2.\r\n<br><br>\r\nThe engine feeds its power through an eight-speed automatic gearbox and a sport differential to all four wheels. Through fast corners, the differential actively distributes the engine’s power between the rear wheels, which Audi says helps to reduce understeer.\r\n<br><br>\r\nChassis upgrades over the standard Audi Q7 include uprated brake discs, larger calipers and sport air suspension. Larger diameter carbon ceramic brakes are available as an optional extra, as is Audi’s active electromechanical roll stabilisation system and all-wheel steering.\r\n<br><br>\r\nAudi claims its all-wheel steering system makes the SQ7 easier to manoeuvre. At low speeds, the rear wheels turn up to five degrees in the opposite direction to the front, which reduces the car’s turning circle. At higher speeds, the front and rear wheels turn in the same direction, which Audi says improves stability.\r\n<br><br>\r\nFrom the outside, the new SQ7 receives Audi’s usual "S" styling treatment, with 20-inch alloy wheels, more aggressive front and rear bumpers, larger side-skirts, aluminium-look mirror caps and the brand’s trademark chromed quad exhaust tips.\r\n<br><br>\r\nInside, the new SQ7 features a pair of leather and Alcantara trimmed sports seats, stainless steel pedals, aluminium trim, a 12.3-inch digital gauge cluster and an 8.3-inch infotainment system with support for Amazon Alexa, Android Auto and Apple CarPlay.\r\n<br><br>\r\nCarbon fibre interior trim inlays are available as an optional extra, as is a premium Bang & Olufsen sound system, four-zone automatic air conditioning and a customisable ambient lighting package. Elsewhere, the SQ7 is optionally available with Matrix LED headlights and a soft-close power assist function for its doors.', 1),
(20, 'Vatican receives modified Dacia Duster as new Popemobile', '2019-11-27', 'Autocar', 13, 'Renault has gifted a specially modified Dacia Duster to the head of the Catholic Church, Pope Francis. \nThe budget SUV has been adapted to suit papal needs by Dacia’s Prototype department and Special Needs Team, in partnership with Romanian coachbuilder Romturingia. \nThe new Popemobile offers the same five-seat layout as the standard Duster but has a "particularly comfortable" rear bench added to suit lengthy public parades. \nAlso featured are a large sunroof, roof-mounted grab handles and, as is customary with Popemobiles from all marques, a removable transparent display box to allow crowds a better look at His Holiness.\nThe Duster is finished in white with a leather interior, and its suspension has been lowered by 30mm to allow for easier ingress and egress. \nIt was delivered to The Vatican by Christophe Dridi, managing director of Groupe Renault Romania, and Xavier Martinet, general manager of Groupe Renault Italy.\nThe Duster won''t be the Pope''s first experience of a Dacia; during a 2016 visit to Armenia, he used an unmodified example of the Logan saloon as his official transport. He promotes frugality and modesty, whereas his predecessors rode in a variety of premium vehicles, including those from Mercedes-Benz and Range Rover.\nIn 2017, Lamborghini gifted Pope Francis a Huracán specially painted in the official colours of The Vatican. After he had blessed and autographed the car, it was sold at a charity auction for £630,000.', 4),
(21, 'Citroen C4 Cactus successor to get battery power', '2019-11-28', 'AutoNews Europe', 14, 'PARIS -- Citroen will add a full-electric version of the C4 Cactus successor when the compact hatchback is renewed next year, CEO Linda Jackson said.\n\nThe battery-powered variant of the C4 Cactus replacement will be Citroen''s first mass-market EV.\n\nStarting next year every new Citroen will have plug-in hybrid or full EV versions, depending on the platform, as well as gasoline versions, Jackson said. There will also be diesel versions for as long as there is enough demand for diesels, she said.\n\n"By 2025, 100 percent of our range will have electrified versions," Jackson told Automotive News Europe in an interview.\n\nCitroen''s electrification expansion will start with a plug-in version of the C5 Aircross compact SUV that will go on sale next year.\n\nFor the C4 Cactus replacement, Citroen will use an extended version of its CMP architecture, which can accommodate internal combustion and electric drivetrains.\n\nThe platform underpins the Peugeot 208 and Opel Corsa small hatchbacks, the DS 3 Crossback small SUV, as well as the upcoming Peugeot 2008 small SUV.\n\nPSA currently sells battery-electric versions of the 208, Corsa and DS 3 Crossback, along with versions with combustion engines.\n\nJackson did not say when the C4 Cactus replacement will be unveiled or when production would start.\n\nCitroen expects the car''s electric version to be more successful than the brand''s C-Zero full-electric minicar, a version of the Mitsubishi i-MiEV. C-Zero sales in Europe were just 929 in the first 10 months, according to JATO Dynamics market researchers.\n\nThe C4 Cactus replacement will be a "very important launch for us," Jackson said.\n\nCitroen''s electrification of its its lineup will start with the launch of a plug-in version of the C5 Aircross compact SUV next year.\n\nSUV rebound\n\nCitroen sales have rebounded in Europe in the past two years with the introduction of the C3 Aircross and C5 Aircross SUVs as the brand shifted to SUVs and crossovers from its previous focus on minivans after market demand shifted to vehicles with a high seating position.\n\nThe brand''s European sales increased 6.4 percent to 546,036 in the first 10 months, according to JATO data.\n\nHowever, demand for the aging C4 Cactus is falling. Its European sales were down 8 percent to 45,966 in Europe through October. The model''s best sales year was 2015 when 79,000 were sold.\n\nThe C4 Cactus was originally a crossover-styled small car when it launched in 2014 but was repositioned as a compact hatchback after a 2017 restyling when Citroen began to phase out the conventionally styled C4 compact hatchback. The C4 hatchback had residual sales of 202 in the first 10 months.\n\nCitroen has not said whether the C4 Cactus successor will keep Cactus as part of its name or be simply called the C4.\n\nThe C4 Cactus was the first Citroen to use the brand''s new styling language, including distinctive plastic cladding on the bodywork that the brand calls "air bumps." The cladding protects the body from minor bumps in congested cities and parking lots. It is now used in a much smaller form on facelifted C4 Cactus launched in 2917 and on the new C3, C3 Aircross and C5 Aircross.\n\nThe current C4 Cactus is based on PSA''s PF1 architecture, as is the current C3 small hatchback.\n\nPSA has two main new platforms: CMP for small cars and EMP2 for midsize vehicles. The platforms overlap in the compact segment.\n\nJackson said a midsize sedan that will replace the now-discontinued C5 will appear at some point after the C4 Cactus replacement.\n\nThe car will take as its inspiration the CXperience concept shown in 2016, she said.', 3);
